import React from "react";
import "./profile.scss";
import anime from 'animejs/lib/anime.es.js';

class Profile extends React.Component{
    componentDidMount() {
        const ad = document.getElementById('kate');
        ad.style.display = 'block';
        ad.style.bottom = '15px';
        ad.style.visibility = 'visible';
    }

    render() {
        var tl = anime.timeline({
            easing: 'easeOutExpo',
            duration: 750
        });
        tl
        .add({
            targets: '#kate',
            translateX: 750,
            scale: 3,
            // duration: 3000
        })
        .add({
            targets: '.about',
            translateX: -400,
            scale: 3,
            // duration: 3000
        })


        // anime({
        //     targets: '#kate',
        //     translateX: 750,
        //     scale: 3,
        //     duration: 3000
        // });
        // anime({
        //     targets: '.about',
        //     translateX: -400,
        //     scale: 3,
        //     duration: 3000
        // });
        return (
            <main>
                <img src="./img/IMG_0070.jpg" id="kate"/>
                <div className="about">
                    Hi! I am Kate. I am Software Engineer at Huawei.
                </div>
            </main>
        );
    }
};

export default Profile;
